export const deleteMovie = key => ({
  type: "DELETE_MOVIE",
  payload: key
});

export const editTodo = key => ({
  type: "EDIT_TODO",
  payload: key
});

export const editAddTodo = obj => ({
  type: "EDIT_ADD_TODO",
  payload: obj
});

export const deleteAll = () => ({
  type: "DELETE_ALL"
});
